import React from 'react';
import {useTranslation} from 'react-i18next';
import {
  Modal,
  StyleSheet,
  Text,
  View,
  FlatList,
  TouchableOpacity,
} from 'react-native';
import {
  responsiveFontSize,
  responsiveHeight,
  responsiveWidth,
} from 'react-native-responsive-dimensions';
import Icon from 'react-native-vector-icons/Entypo';
import {AppColor} from '../constants/Colors';

export const Item = ({item, onSelect, t}) => (
  <TouchableOpacity
    testID={'itemTouchable'}
    onPress={() => {
      onSelect(item.en ? item : item + ' ' + 'Hours');
    }}
    style={styles.item}>
    <View>
      <Text style={styles.date}>{item.date}</Text>
      <Text style={styles.text}>
        {item.name ? item.name : item + ' ' + t('siteManager.hours')}
      </Text>
    </View>
  </TouchableOpacity>
);
const ModalBox = ({data, visible, onSelect, onClose}) => {
  const {t} = useTranslation();

  const renderItem = ({item}) => <Item item={item} t={t} onSelect={onSelect} />;
  return (
    <Modal transparent visible={visible}>
      <View style={styles.container}>
        <View style={styles.subContainer1}>
          <View style={{width: '100%', paddingHorizontal: responsiveWidth(10)}}>
            <Icon
              testID={'cross'}
              name={'cross'}
              size={32}
              color={'#000'}
              style={{alignSelf: 'flex-end'}}
              onPress={() => {
                onClose();
              }}
            />
          </View>
          <FlatList
            data={data}
            renderItem={renderItem}
            keyExtractor={item => item.id}
            showsVerticalScrollIndicator={false}
          />
        </View>
      </View>
    </Modal>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    paddingHorizontal: 15,
    alignItems: 'center',
    backgroundColor: 'rgba(0,0,0,0.2)',
    justifyContent: 'center',
  },
  item: {
    width: '100%',
    alignItems: 'center',
    alignSelf: 'center',
    flexDirection: 'row',
    justifyContent: 'space-between',
    borderBottomWidth: 1,
    borderBottomColor: AppColor.TextColorLight,
  },
  date: {
    fontSize: responsiveFontSize(2.5),
    fontWeight: '700',
  },
  subContainer1: {
    maxHeight: responsiveHeight(90),
    justifyContent: 'center',
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: {
      width: 0,
      height: 2,
    },
    shadowOpacity: 0.25,
    shadowRadius: 3.84,

    elevation: 5,
    paddingVertical: responsiveHeight(3),
    width: responsiveWidth(100),
    position: 'absolute',
    bottom: 0,
    backgroundColor: AppColor.BgColorPrimary,
    borderTopLeftRadius: responsiveWidth(5),
    borderTopRightRadius: responsiveWidth(5),
  },
  text: {
    fontSize: responsiveFontSize(2.1),
    width: responsiveWidth(77),
    marginBottom: responsiveHeight(3),
  },
});

export default ModalBox;

