import React, {useState} from 'react';
import {useTranslation} from 'react-i18next';
import {
  Modal,
  SafeAreaView,
  StyleSheet,
  Text,
  TouchableOpacity,
  View,
} from 'react-native';
import QRCodeScanner from 'react-native-qrcode-scanner';
import {
  responsiveFontSize,
  responsiveHeight,
  responsiveWidth,
} from 'react-native-responsive-dimensions';
import {AppColor} from '../constants/Colors';
import {CameraMarker, ChevronLeft, Torch} from '../constants/Images';

const STQRScanner = ({visible, onHide, onRead}) => {
  const [torchOn, setTorchOn] = useState(false);

  const {t} = useTranslation();

  /**
   * This method is called when a QR code is scanned
   * @param {object} data data scanned from QR code
   */
  const onReadQR = data => {
    onRead(data);
  };

  /**
   * When back button is pressed
   */
  const onPressBack = () => {
    onHide(false);
  };

  return (
    <Modal visible={visible} presentationStyle={'fullScreen'}>
      <SafeAreaView style={{flex: 1, backgroundColor: '#2D2D2D'}}>
        <View style={{flex: 1, backgroundColor: '#2D2D2D'}}>
          <QRCodeScanner
            onRead={onReadQR}
            showMarker
            containerStyle={{backgroundColor: '#000000'}}
            cameraProps={{flashMode: torchOn ? 'torch' : 'off'}}
            customMarker={
              <CameraMarker
                fill={'#FFFFFF'}
                height={responsiveHeight(30)}
                width={responsiveHeight(30)}
              />
            }
            topContent={
              <TouchableOpacity onPress={() => onPressBack()}>
                <ChevronLeft
                  height={responsiveHeight(3)}
                  width={responsiveHeight(3)}
                  fill={'#fff'}
                />
              </TouchableOpacity>
            }
            bottomContent={
              <View style={styles.buttonTouchable}>
                <Text style={styles.buttonText}>{t('results.aimAt')}</Text>
                <TouchableOpacity
                  onPress={() => setTorchOn(!torchOn)}
                  style={{
                    alignSelf: 'center',
                    marginVertical: responsiveHeight(2),
                    marginTop: responsiveHeight(5),
                  }}>
                  <Torch
                    height={responsiveHeight(6)}
                    width={responsiveHeight(6)}
                    fill={AppColor.PrimaryLight}
                  />
                </TouchableOpacity>
                <Text
                  style={[
                    styles.buttonText,
                    {fontSize: responsiveFontSize(1.5)},
                  ]}>
                  {t('results.turnOnFlashlight')}
                </Text>
              </View>
            }
            topViewStyle={{
              alignItems: 'flex-start',
              top: -50,
              paddingHorizontal: 15,
            }}
          />
        </View>
      </SafeAreaView>
    </Modal>
  );
};

const styles = StyleSheet.create({
