import {
  SET_TOKEN,
  SET_CURRENT_USER,
  SET_REGISTERED_SITE,
  SET_VACCINE,
  SET_RESULT,
  SET_NOTIFICATIONS,
  SET_LOADING,
  SET_HOSPITAL_NAME,
  SET_PROFILE_IMAGE,
} from '../../type';

const initialState = {
  token: '',
  result: '',
  currentUser: [],
  registeredSite: [],
  vaccineResults: [],
  notify: false,
  loading: false,
  hospitalName: '',
  profileImage: '',
};

const userReducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_TOKEN:
      return {
        ...state,
        token: action.payload,
      };
    case SET_CURRENT_USER:
      return {
        ...state,
        currentUser: action.payload,
      };
    case SET_REGISTERED_SITE:
      return {
        ...state,
        registeredSite: action.payload,
      };
    case SET_VACCINE:
      return {
        ...state,
        vaccineResults: action.payload,
      };
    case SET_RESULT:
      return {
        ...state,
        result: action.payload,
      };
    case SET_NOTIFICATIONS:
      return {
        ...state,
        notify: action.payload,
      };
    case SET_LOADING:
      return {
        ...state,
        loading: action.payload,
      };
    case SET_HOSPITAL_NAME:
      return {
        ...state,
        hospitalName: action.payload,
      };
    case SET_PROFILE_IMAGE:
      return {
        ...state,
        profileImage: action.payload,
      };
    default:
      return state;
  }
};

export default userReducer;

