import {SUCCESS} from '../../../constants/Routes';
import {SIGN_UP_URL} from '../../../constants/ApiRoutes';
import {Logo} from '../../../constants/Images';
import {PostRequest} from '../../../utils/apiRequests';
import {saveData} from '../../../utils/asyncRequests';
import Toast from '../../../components/Toast';

/**
 * this functional component is for confirming choosen image
 * if user confirms image it will call for completion of signup process
 * otherwise user can choose another image
 * @param {props} param0 navigation and route props
 * @returns component for confirm image
 */
const ConfirmImage = ({route, navigation}) => {
  const {t} = useTranslation('en');
  const obj = route.params.obj;
  const [processing, setProcessing] = useState(false);

  /**
   * Method to call post request of sign up
   */
  const confirmSighUp = async () => {
    setProcessing(true);
    var formdata = new FormData();
    formdata.append('name', obj.name);
    formdata.append('password', obj.password);
    formdata.append('phone', obj.phone);
    formdata.append('dob', obj.dob);
    formdata.append('gender', obj.gender);
    formdata.append('photo', {
      uri: obj.photo,
      type: 'image/jpeg',
      name: 'photo.jpg',
    });
    let userData = {
      name: obj.name,
      dob: obj.dob,
      gender: obj.gender,
    };
    await PostRequest(SIGN_UP_URL, formdata, null, 'multipart/form-data')
      .then(async response => {
        if (response.status === 201) {
          await saveData(obj.phone, JSON.stringify(userData));
          navigation.navigate(SUCCESS, {screen: 'image'});
        }
      })
      .catch(error => {
        if (error.response.status === 400) {
          if (error.response.data.message === 'Invalid phone number') {
            Toast(t('siteManager.invalidPhoneNumber'), 'error');
          } else if (
            error.response.data.message ===
            'User validation failed: photo: required'
          ) {
            Toast(t('signup.imageRequired'), 'error');
          }
        }
        if (error.response.status === 409) {
          if (
            error.response.data.message === 'Phone number already registered'
          ) {
            Toast(t('signup.accountExists'), 'error');
          }
        } else {
          Toast('Try again later!', 'error');
        }
      })
      .finally(() => {
        setProcessing(false);
      });
  };

  /**
   * this method will be called when change image button will be pressed
   */
  const onChangeImagePressed = () => {
    navigation.goBack();
  };

  return (
    <SafeAreaView style={styles.safeAreaView}>
      <View style={styles.container}>
        <StatusBar
          barStyle={'dark-content'}
          backgroundColor={AppColor.Secondary}
        />
        <View style={{top: 10}}>
          <Logo height={62} width={62} fill={AppColor.BgColorSecondary} />
        </View>
        <Separator height={20} />
        <Image style={styles.image} source={{uri: obj.photo}} />
        <Text style={styles.note}>{t('signup.confirmNote')}</Text>
        <Separator height={responsiveHeight(6)} />
        <ButtonLight
          testID={'changeImageBtn'}
          onPress={() => onChangeImagePressed()}
          title={t('buttons.changePhoto')}
        />
        <Separator height={responsiveHeight(2)} />
        <Button
          testID={'confirmImageBtn'}
          showLoading={processing}
          disabled={processing}
          onPress={() => confirmSighUp()}
          title={t('buttons.confirm')}
        />
        <Separator height={responsiveHeight(4)} />
      </View>
    </SafeAreaView>
  );
};
const styles = StyleSheet.create({
  safeAreaView: {
    flex: 1,
    backgroundColor: '#fff',
  },
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  image: {
    height: responsiveHeight(35),
    width: responsiveHeight(35),
    borderRadius: responsiveHeight(2),
  },
  note: {
