import ResultModal from '../../../components/ResultModal';

var height = Dimensions.get('screen').height;

/**
 * this functional component is for reset password
 * @param {object} param0 navigation and route props
 * @returns component
 */
const MyProfile = ({navigation, route}) => {
  const [qrScanner, setQrScanner] = useState(false);
  const [message, setMessage] = useState(false);
  const [resModalVisible, setResModalVisible] = useState(false);
  const {t} = useTranslation('en');
  let [linkingData, setLinkingData] = useState(
    route.params ? route.params.data : '',
  );

  useEffect(() => {
    Linking.addEventListener('url', handledeeplink);
  });

  /**
   * Handle deep links
   */
  const handledeeplink = useCallback(async event => {
    let url = new URL(event.url);
    if (url.includes('welcome')) {
      setLinkingData('welcome');
    }
  }, []);

  /**
   * Method to close QRScanner
   */
  const onPressCloseScanner = (qrResults, site) => {
    setQrScanner(false);
    if (qrResults) {
      if (qrResults === 'matched') {
        setMessage(t('myPass.welcome', {siteName: site}));
        setResModalVisible(true);
      } else if (qrResults === 'oldpass_valid') {
        setMessage(t('myPass.validOldPass'));
        setResModalVisible(true);
      } else {
        setMessage(t('myPass.informationNotMatching'));
        setResModalVisible(true);
      }
    }
  };

  /**
   * Method to show results
   */
  const onCloseResults = () => {
    setResModalVisible(false);
  };

  return (
    <SafeAreaView style={styles.safeAreaView}>
      <View style={styles.container}>
        <StatusBar
          barStyle={'light-content'}
          backgroundColor={AppColor.Secondary}
        />
        <ResultModal
          visible={resModalVisible}
          message={message}
          onPressClose={onCloseResults}
        />
        <QRScanner
          visible={qrScanner}
          userType={'user'}
          onPressCloseScanner={onPressCloseScanner}
        />
        <Header title={t('myProfile.myProfile')} navigation={navigation} />
        {!qrScanner && (
          <View style={styles.middleViewCont}>
            <View style={styles.middleView}>
              <Tabs navigation={navigation} linkingData={linkingData} />
              <ActionButton
                buttonColor={AppColor.FloatingActionButton}
                size={responsiveFontSize(7)}
                offsetX={0}
                offsetY={responsiveFontSize(2)}
                onPress={() => setQrScanner(true)}
                renderIcon={() => (
                  <Qr
                    height={responsiveFontSize(4)}
                    width={responsiveFontSize(4)}
                    fill={AppColor.PrimaryLight}
                  />
                )}
              />
            </View>
          </View>
        )}
      </View>
    </SafeAreaView>
  );
};

