import Axios from 'axios';
/**
 * Post request handler
 * @param {string} url Api endpoint
 * @param {object} data Data to be transfered
 * @param {string} token Auth token
 * @param {string} contentType Content type
 * @param {*} cancelToken cancelToken
 * @returns Promise<object>
 */
export const PostRequest = async (
  url,
  data,
  token = null,
  contentType = 'application/json',
  cancelToken = null,
) => {
  return await Axios({
    url: url,
    method: 'POST',
    cancelToken: cancelToken,
    headers: {
      Accept: 'application/json',
      'Content-Type': contentType,
      Authorization: token,
    },
    data: data,
  });
};

/**
 * Get request handler
 * @param {String} url Api endpoint
 * @param {String} token Auth token
 * @returns Promise<Object>
 */
export const GetRequest = async (url, token = null) => {
  return await Axios({
    url: url,
    method: 'GET',
    headers: {
      Accept: 'application/json',
      'Content-Type': 'application/json',
      Authorization: token,
    },
  });
};

/**
 * Post request handler
 * @param {XMLHttpRequest} instance of xmlHttpRequest
 * @param {string} url Api endpoint
 * @param {object} data Data to be transfered
 * @param {string} token Auth token
 * @param {Function} handleProgress method/state to handle progress
 * @param {Function} onLoad method/state for getting results on request completeion
 * @param {Function} onError method/state for getting results on error
 * @param {string} contentType Content Type
 * @returns Promise<object>
 */
export const xhrPostRequest = (
  xhr,
  url,
  data,
  token = null,
  handleProgress,
  onLoad,
  onError,
  contentType = 'multipart/form-data',
) => {
  xhr.upload.addEventListener('progress', handleProgress);

  let response = {};

  xhr.addEventListener('load', () => {
    response = xhr.response;

    onLoad(response, xhr.status);
  });

  xhr.addEventListener('error', onError);

  xhr.open('POST', url);
  xhr.setRequestHeader('Authorization', token);
  xhr.setRequestHeader('Content-Type', contentType);
  xhr.send(data);
};

