/**
 * This method is for converting larger numbers to n Format
 * @param {number} value Value to be converted to n Format
 * @returns number
 */
export const nFormatter = value => {
  try {
    // suffix = {' ', 'k', 'M', 'B', 'T', 'P', 'E'};

    if (value >= 1000000 && value < 1000000 * 10 * 100) {
      // less than 100 million
      const result = value / 1000000;
      return result.toFixed(4) + ' M';
    } else if (
      value >= 1000000 * 10 * 100 &&
      value < 1000000 * 100 * 100 * 100
    ) {
      // less than 100 billion
      const result = value / (1000000 * 10 * 100);
      return result.toFixed(4) + ' B';
    } else if (value >= 1000000 * 10 * 100 * 100) {
      // less than 100 trillion
      const result = value / (1000000 * 100 * 100 * 100);
      return result.toFixed(4) + ' T';
    } else {
      return value.toFixed(4);
    }
  } catch (e) {}
};

/**
 * This method is for converting larger numbers to kmbt Format
 * @param {number} value Value to be converted to kmbt Format
 * @param {number} decimals upto decimal places
 * @returns number
 */
export const kmbtFormatter = (value, decimals) => {
  try {
    // suffix = {' ', 'k', 'M', 'B', 'T', 'P', 'E'};

    if (
      (value >= 1000 && value < 1000000) ||
      (value < -1000 && value >= -1000000)
    ) {
      // less than a million
      const result = value / 1000;
      return result.toFixed(decimals) + 'K';
    } else if (
      (value >= 1000000 && value < 1000000 * 10 * 100) ||
      (value < -1000000 && value >= -1000000 * 10 * 100)
    ) {
      // less than 100 million
      const result = value / 1000000;
      return result.toFixed(decimals) + ' M';
    } else if (
      (value >= 1000000 * 10 * 100 && value < 1000000 * 100 * 100 * 100) ||
      (value < -1000000 * 10 * 100 && value >= -1000000 * 100 * 100 * 100)
    ) {
      // less than 100 billion
      const result = value / (1000000 * 10 * 100);
      return result.toFixed(decimals) + ' B';
    } else if (
      value >= 1000000 * 10 * 100 * 100 ||
      value <= -1000000 * 10 * 100 * 100
    ) {
      // less than 100 trillion
      const result = value / (1000000 * 100 * 100 * 100);
      return result.toFixed(decimals) + ' T';
    } else {
      return value.toFixed(decimals);
    }
  } catch (e) {}
};

